import React from 'react';

const Cart = (props) => {
    const cart = props.cart;

    let total = 0;
    for (let i = 0; i < cart.length; i++) {
        const product = cart[i];
        total = product.price;
        
    }

    console.log(cart);
    return (
        <div>
            <h1>This is All about Cart</h1>
            <h3>Order Summary:{cart.length}</h3>
            <p><small>Price: {total}</small></p>
        </div>
    );
};

export default Cart;
